import React, { ReactElement } from "react";
import styled from "styled-components/native";
import { View, H1, TextInput, Button, Text } from "../../styles";
import { ScrollView, StyleSheet, _View } from "react-native";
import { AntDesign } from "@expo/vector-icons";

const ProfileDiv = styled(View)`
  flex: 1;
  padding-top: 100px;
  padding-bottom: 100px;

  padding-left: 10px;
  padding-right: 10px;
  align-items: center;
`;

// const ProfileDiveStyles = StyleSheet.create({
//   center: {
//     alignItems: "center",
//   },
// });

const ProfileImage = styled.Image`
  width: 150px;
  height: 150px;
`;

const ProfileName = styled(Text)`
  font-size: 30px;
  margin-top: 20px;
`;

const ProfileBio = styled(Text)`
  font-size: 20px;
  margin-top: 20px;
  text-align: center;
`;

const EditProfile = styled.TouchableOpacity`
  padding-top: 10px;
  padding-bottom: 10px;
  padding-right: 20px;
  padding-left: 20px;
  border-radius: 5px;
  font-size: 1.25rem;
  font-weight: bold;
  border: 1px;
  border-radius: 5px;
  border-color: ${(props: any) => props.theme.text};
  color: ${(props: any) => props.theme.text};
  width: 200px;
  text-align: center;
  margin-top: 25px;
  margin-bottom: 10px;
`;

const ProfileLinks = styled(View)``;

interface Props {}

export default function Profile({}: Props): ReactElement {
  return (
    <ProfileDiv
    // contentContainerStyle={ProfileDiveStyles}
    >
      <ProfileImage source={require("../../assets/base/person.png")} />
      <EditProfile>Edit Profile</EditProfile>
      <ProfileName>Akhil Kala</ProfileName>
      <ProfileBio>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Fugit ipsum
        est, quae dolorum dignissimos delectus mollitia maxime numquam, saepe
        omnis culpa, in quisquam doloribus tempore corrupti magnam impedit eaque
        tenetur?
      </ProfileBio>
      <ProfileLinks>
        <AntDesign name="linkedin-square" size={24} color="black" />
        <AntDesign name="github" size={24} color="#fefefe" />
      </ProfileLinks>
    </ProfileDiv>
  );
}
